import React from 'react';
import './GroupsPage.css';

const GroupsPage = () => {
  return (
    <div className="groups-page">
      <h1>Groups</h1>
      <p>This page will display your groups (placeholder)</p>
    </div>
  );
};

export default GroupsPage;
